import React from 'react'
import styled from 'styled-components'
import YouTube from '../img/logo.png'
import HomeIcon from '@mui/icons-material/Home';

const Container = styled.div`
    flex: 1;
    background-color: #202020;
    height: 100vh;
    color: white;
`;

const Wrapper = styled.div`
    padding: 18px 26px;
`;

const Logo = styled.div`
    display: flex;
    align-items: center;
    gap: 5px;
    front-weight: bold;
    margin-button: 25px;
`;

const Img = styled.img`
    height: 25px;
`

const Item = styled.div`
    display: flex;
    align-items: center;
    gap: 20px;
    cursor: pointer;
`

const Menu = () => {
    return (
        <Container>
            <Wrapper>
                <Logo>
                    <Img src={YouTube}/>
                    YouTube
                </Logo>
                <Item>
                    <HomeIcon/>
                    Home
                </Item>
            </Wrapper>
        </Container>
    )
}

export default Menu
